            <span class="gapps-panel-icons" style={{'background-position': '0 -2070px'}} />
            {t('jamboard')}
        </a>
    </li>
);

const Classroom = () => (
    <li>
        <a href="https://mail.google.com/mail/">
            <span class="gapps-panel-icons" style={{'background-position': '0 -966px'}} />
