        </a>
    </li>
);

const Forms = () => (
    <li>
        <a href="https://mail.google.com/mail/">
            <span class="gapps-panel-icons" style={{'background-position': '0 -2139px'}} />
            {t('forms')}
        </a>
    </li>
);

const AllApps = () => (
    <div class="more-from-google">
        <a href="https://mail.google.com/mail/" target="_blank">
            {t('more_from_google')}
        </a>
    </div>
);
